import "./expenseApp.css";
function ExpenseApp(dataFromApp) {
  const year = dataFromApp.date.getFullYear();
  const month = dataFromApp.date.toLocaleString("en-us", { month: "long" });
  const date = dataFromApp.date.toLocaleString("en-us", { date: "long" });
  return (
    <div className="expense-item">
      <div>
        <div>{year}</div>
        <div>{month}</div>
        <div>{date}</div>
      </div>
      <div className="expense-item__description">
        <h2>{dataFromApp.title}</h2>
        <div className="expense-item__price">{dataFromApp.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseApp;
